Aspose.Network for SharePoint 1.1.0
Download&nbsp;
Support Forum&nbsp;
File Details
Downloads: 5 File Size: 2.3 MB Posted By: saqib.razzaq Views: 371 Date Added: 3/4/2011
.downloadcount {
background-image: url("/images/loading.svg");
background-repeat: no-repeat;
background-size: 21px;
background-position: -2px 10px;
color: transparent;
}
$.getJSON("https:\/\/releases.admin.aspose.com/api/updatecount?path=d49eeae8c1d84d2eb896698c5b8c2a78&single=1", function(data) { $.each(data, function(key, value) {
$("#dwn-update-"+ key).css({"background":"none"});
$("#dwn-update-"+ key).css({"color":"#333"});
$("#dwn-update-"+ key).text(value.download_count);
$("#added-update-"+ key).text(value.date_added);
});
});

